import { Typography } from '@material-ui/core'
import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { myDonationOrRequestRequests } from '../../actions/userActions'
import CustomContainer from '../../components/CustomContainer'

function MyDonationsScreen() {

    const dispatch = useDispatch()
    const userDonationList = useSelector(state => state.userDonations)
    React.useEffect(() => {
        dispatch(myDonationOrRequestRequests('Request'))
    }, [])
    console.log(userDonationList.donations)
    return (
        <div>
            {userDonationList?.donations?.map(item => {
                return (
                    <CustomContainer>
                        <div style={{display:'flex',justifyContent:'space-between',paddingLeft:'50px',paddingRight:'50px'}} >
                            <Typography variant='h4' noWrap >{item.restaurant}</Typography>
                            <Typography variant='h4' noWrap >{item.serving}</Typography>
                            <Typography variant='h4' noWrap >{item.quantity}</Typography>
                        </div>
                    </CustomContainer>
                )
            })}
        </div>
    )
}

export default MyDonationsScreen
